def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index

    clocs = [index._get_level_number(i) for i in clocs]

    rlocs = [i for i in range(index.nlevels) if i not in clocs]

    clevels = [index.levels[i] for i in clocs]
    ccodes = [index.codes[i] for i in clocs]
    cnames = [index.names[i] for i in clocs]

    if isinstance(data, Series):
        raise ValueError("Unstacking a Series with MultiIndex is not supported")
    else:
        dummy = data.copy()

        if len(clocs) < len(index.levels):
            dummy = dummy.unstack(clocs, fill_value=fill_value)
            unstacked_index = dummy.index
            new_columns = MultiIndex.from_tuples(
                [
                    (unstacked_index.names[i], unstacked_index.levels[i][code])
                    for i, code in enumerate(unstacked_index.codes)
                ],
                names=[x if i < len(clocs) else None for i, x in enumerate(cnames)],
            )
            dummy.columns = new_columns
        else:
            dummy = dummy.unstack(clocs[-1], fill_value=fill_value)
            unstacked_index = dummy.index
            new_columns = MultiIndex.from_tuples(
                [
                    (unstacked_index.names[i], unstacked_index.levels[i][code])
                    for i, code in enumerate(unstacked_index.codes)
                ],
                names=[None] + cnames,
            )
            dummy.columns = new_columns

        return dummy
